const ProfileArtist = object({
  type: literal(PROFILE_TYPE_ARTIST),
  publishedTracks: NonNegativeInteger,
});

const Colour = enums(COLOURS);
const HexColour = pattern(string(), /^#[a-fA-F0-9]{6}$/);
